game.modding.tick = function(t){
  this.game.tick(t);
  if (this.context.tick != null){
    this.context.tick(this.game);
  }
};  
 
this.event = function(event, game){
  var ship = event.ship;  
  var ship_level = Math.trunc(ship.type / 100);
  var max_crystals = 980;    
  var new_type;  
  var tree = ship.custom.tree;
  var index = -1;
  switch (event.name){
    case "ui_component_clicked":
      var component = event.id;
      if (component == "Options"){
        ship.setUIComponent({
          id: "Next ship",
          position: [28,35,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Next ship",color:"#CDE"},
          ]
        });
        ship.setUIComponent({
          id: "Previous ship",
          position: [60,35,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Previous ship",color:"#CDE"},
          ]
        });    
        ship.setUIComponent({
          id: "Reset",
          position: [28,45,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Reset",color:"#CDE"},
          ]
        });  
        ship.setUIComponent({      
          id: "Stats",
          position: [28,55,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Stats",color:"#CDE"},
          ]
        });  
        ship.setUIComponent({
          id: "Spectate",
          position: [60,45,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Spectate",color:"#CDE"},
          ]
        });  
        ship.setUIComponent({      
          id: "Gems",
          position: [60,55,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Gems",color:"#CDE"},
          ]
        });          
        ship.setUIComponent({
          id: "Options screen circle",
          position: [42,36.5,80*1.35,100*1.35],
          clickable: false,
          visible: true,
          components: [
            {type:"round",position:[0,0,15,20],fill:"rgba(68, 85, 102, 0)",stroke:"#43454a",width:5},
          ]
        });    
        ship.setUIComponent({
          id: "Options screen exit",
          position: [63,65,12,10],
          clickable: true,
          visible: true,
          components: [
            { type:"box",position:[0,0,100,100],fill:"rgba(68, 85, 102, 0)",stroke:"#CDE",width:4},
            { type: "text",position:[5,35,90,40],value:"Close",color:"#CDE"},
          ]
        });        
        ship.setUIComponent({
          id: "Options screen",
          position: [0,25,100,200],
          clickable: false,
          visible: true,
          components: [
            {type:"box",position:[25,0,50,25],fill:"rgba(68, 85, 102, 0)",stroke:"#ffffff",width:3},
            {type: "text",position: [45,0,10,5],color: "#ffffff",value: "Options"},
          ]
        });   
      }  
      else if (component == "Next ship"){
        index = ship_list[tree].indexOf(ship.type);
        if (index >= 0) {
          index = (index + 1) % ship_list[tree].length;
          new_type = ship_list[tree][index];
          shipLevel = Math.trunc(new_type / 100);
          if (shipLevel === 1){
            max_crystals = 20;
          } else
          if (shipLevel === 2){
            max_crystals = 80;
          } else
          if (shipLevel === 3){
            max_crystals = 180;
          } else
          if (shipLevel === 4){
            max_crystals = 320;
          } else
          if (shipLevel === 5){
            max_crystals = 500;
          } else
          if (shipLevel === 6){
            max_crystals = 720;
          } else {
            max_crystals = 980;
          }
          ship.set({crystals:max_crystals});    
          if (ship_level < 7){      
            ship.set({shield:999, stats:88888888});      
          }        
          ship.set({type:new_type, shield:999});
        }
      }
      else if (component == "Previous ship"){
        index = ship_list[tree].indexOf(ship.type);
        if (index >= 0) {
          index = (index - 1) % ship_list[tree].length;
          new_type = ship_list[tree][index];
          shipLevel = Math.trunc(new_type / 100);
          if (shipLevel === 1){
            max_crystals = 20;
          } else
          if (shipLevel === 2){
            max_crystals = 80;
          } else
          if (shipLevel === 3){
            max_crystals = 180;
          } else
          if (shipLevel === 4){
            max_crystals = 320;
          } else
          if (shipLevel === 5){
            max_crystals = 500;
          } else
          if (shipLevel === 6){
            max_crystals = 720;
          } else {
            max_crystals = 980;
          }
          ship.set({crystals:max_crystals});            
          if (ship_level < 7){      
             ship.set({shield:999, stats:88888888});      
          }  
          ship.set({type:new_type, shield:999});
        }
      }
      else if (component == "Spectate"){
        ship.set({type:102, crystals:20, stats:11111111});
      }
      else if (component == "Gems"){
        if (ship_level === 1){
          max_crystals = 20;
        } else
        if (ship_level === 2){
          max_crystals = 80;
        } else
        if (ship_level === 3){
          max_crystals = 180;
        } else
        if (ship_level === 4){
          max_crystals = 320;
        } else
        if (ship_level === 5){
          max_crystals = 500;
        } else
        if (ship_level === 6){
          max_crystals = 720;
        } else {
          max_crystals = 980;
        }
        ship.set({crystals:max_crystals});
      }
      else if (component == "Reset"){
        ship.set({type:101, crystals:20, shield:100, stats:11111111});
      }
      else if (component == "Stats"){
        var stats = ship.stats;
        var max = 11111111 * ship_level;
        if (ship_level < 7){
          if (stats == max){
            ship.custom.keep_maxed = false;
            ship.set({stats:0});
          } else {
            ship.custom.keep_maxed = true;
            ship.set({stats:max, shield:999});
          }
        }
      }
      else if (component == "Restore"){
        if (ship_level === 1){
          max_crystals = 20;
        } else
        if (ship_level === 2){
          max_crystals = 80;
        } else
        if (ship_level === 3){
          max_crystals = 180;
        } else
        if (ship_level === 4){
          max_crystals = 320;
        } else
        if (ship_level === 5){
          max_crystals = 500;
        } else
        if (ship_level === 6){
          max_crystals = 720;
        } else {
          max_crystals = 980;
        }
        ship.set({shield:999, crystals:max_crystals});
      }        
      else if (component == "Options screen exit"){
        ship.setUIComponent({
          id: "Next ship",
          visible: false
        });
        ship.setUIComponent({
          id: "Previous ship",
          visible: false
        });        
        ship.setUIComponent({
          id: "Reset",
          visible: false
        });  
        ship.setUIComponent({      
          id: "Stats",
          visible: false
        });              
        ship.setUIComponent({
          id: "Spectate",
          visible: false
        });  
        ship.setUIComponent({      
          id: "Gems",
          visible: false
        });  
        ship.setUIComponent({
          id: "Options screen",
          visible: false
        });  
        ship.setUIComponent({
          id: "Options screen circle",
          visible: false
        });    
        ship.setUIComponent({
          id: "Options screen go back",
          visible: false,
        });
        ship.setUIComponent({
          id: "Options screen exit",
          visible: false
        });
      }
      else if (component == "Admin ship"){
        ship.set({type:799,stats:11111111,crystals:20});
      }
      break;
    case "ship_spawned":
      ship.set({x:0,y:250,invulnerable:300});
    break;
  }
};

addAliens = (ammount,x,y,code,level,points,crystals,weapon_drop) => {
  for (let i = 0; i<ammount; i++){
    game.addAlien({
      x:x,y:y,
      code:code,
      level:level,
      points:points,
      crystals:crystals,
      weapon_drop:weapon_drop
    });
  }
  switch (code){
    case 10:
      alien_type = "Chicken";
    break;  
    case 11:
      alien_type = "Crab";
    break;  
    case 12:
      alien_type = "Fortress";
    break;  
    case 13:
      alien_type = "Caterpillar";
    break;        
    case 14:
      alien_type = "Candlestick";
    break;        
    case 15:
      alien_type = "Hirsute";
    break;        
    case 16:
      alien_type = "Piranha";
    break;        
    case 17:
      alien_type = "Pointu";
    break;        
    case 18:
      alien_type = "Fork";
    break;        
    case 19:
      alien_type = "Saucer";
    break;        
    case 20:
      alien_type = "FinalBoss";
  }
  switch(weapon_drop){
    case 10:
      collectible = "Rockets";
    break;
    case 11:
      collectible = "Missiles";
    break;
    case 12:
      collectible = "Torpedo";
    break;
    case 20:
      collectible = "Light mines";
    break;
    case 21:
      collectible = "Heavy mines";
    break;
    case 40:
      collectible = "Mining pod";
    break;
    case 41:
      collectible = "Attack pod";
    break;
    case 42:
      collectible = "Defense pod";
    break;
    case 90:
      collectible = "Energy refill";
    break; 
    case 91:
      collectible = "Shield refill";
  }  
  return "\nSpawned "+ammount+" level "+level+" "+alien_type+" to coordinates x:"+x+" y:"+y+"\ndropping "+crystals+" crystals, "+points+" points, and a single\n"+collectible+" upon destruction\n";
};
